import React from 'react';
import  ReactDOM  from 'react-dom/client';

import SearchPanel from './components/search-panel';
import AppHeader from './components/app-header';
import DataTable from './components/data-table/data-table';

const dataForTable =[
    { label : 'Погулять с собакой', important : true, id:42342},
    { label : 'Бассейн', important:false, id:2345 },
    { label : 'Гулять в центр', important:false, id:64225 }
];

const App = ()=>{
    return (
    <div>
    <AppHeader/>
    <SearchPanel/>
    <DataTable datas = {dataForTable}/>    
    </div>);
};

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
    <App />
);

const getResource = async (url) => {
    const res = await fetch (url);
    const body = await res.json();
    return body;
}


getResource('curl -H "X-API-Key: 032062d0" https://my.api.mockaroo.com/students.json/1/')
    .then ( (body) => {
        console.log(body);
    });


